import React from "react";

function Home() {
  return (
    <section class="section">
    <div class="container">
        <h1 class="has-text-centered">Welcome to MusMe: the Library to Find the Soundtrack for You</h1>
        <br></br>
        <p class="subtitle is-5 has-text-centered">MusMe is an affordable subscription-based royalty-free music library powered by TwinsMusic Enterprises, based in Pelham, New York, USA. The library features original music, sound bites, ringtones, and sounds effects fit for hundreds of moods and settings. MusMe sets itself apart from other music libraries because all music in the library is acoustic original music. Each month, the MusMe team updates the library with refreshing new music and sounds so users will never run out of new content. </p>
    </div>
    </section>

  );
}

export default Home;
